SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
BEGIN;
CREATE TABLE "landmarks" (gid serial PRIMARY KEY,
"name" varchar(50),
"address" varchar(50),
"date_built" varchar(10),
"architect" varchar(50),
"landmark" varchar(10));
SELECT AddGeometryColumn('','landmarks','the_geom','4326','MULTIPOLYGON',2);
CREATE INDEX "landmarks_the_geom_gist" ON "landmarks" using gist ("the_geom" gist_geometry_ops);
COMMIT;
